script: |
  super -f text -I q5094.spq | sort > q5094.out

inputs:
  - name: q5094.spq
    data: |
      SELECT + col1 + col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - 90 NOT BETWEEN ( - 67 + col1 - + col0 * col1 ) AND + 97;
  - name: tab2

outputs:
  - name: q5094.out
    data: |
      141
      142
      97
